import { Section, Card } from "../components/Section";
import { Title } from "../components/AnimatedHeading";

export default function Metodo() {
  return (
    <Section>
      <div className="container">
        <Title as='h2'>O Método</Title>
        <Card>
          <ul>
            <li>Juros reais & ciclo econômico como bússola.</li>
            <li>Regras claras de liquidez e proteção.</li>
            <li>Filtro contra ruído e vieses comportamentais.</li>
            <li>Exposição global com racionalidade.</li>
          </ul>
        </Card>
      </div>
    </Section>
  );
}
